import React from "react";

export default function Photos(props) {
  if (props.photos) {
    return (
      <div className="Meaning photos row">
        {props.photos.map(function (photo, index) {
          return (
            <div className="col-4">
              <img
                src={photo.src.landscape}
                className="img-fluid"
                key={index}
              />
            </div>
          );
        })}
      </div>
    );
  } else {
    return null;
  }
}
